INSERT INTO `first_aid_content` (`content_id`, `fa_id`, `content_image`, `content`) VALUES
(1, 1, , 'Call 999 or your local emergency number and tell them the location and condition of the person.');
INSERT INTO `first_aid_content` (`content_id`, `fa_id`, `content_image`, `content`) VALUES
(2, 1, , 'Keep the person still and calm. Do not move their head or neck unless necessary to prevent further injury.');
INSERT INTO `first_aid_content` (`content_id`, `fa_id`, `content_image`, `content`) VALUES
(3, 1, , 'Stop the bleeding by applying firm pressure to the wound with a sterile gauze or a clean cloth. Do not press on the wound if you suspect a skull fracture or if there is an object embedded in the wound. ');
INSERT INTO `first_aid_content` (`content_id`, `fa_id`, `content_image`, `content`) VALUES
(4, 1, , 'If the bleeding does not stop, wrap the wound with a thick bandage or another cloth and tape it securely. Do not remove the first layer of gauze or cloth. If possible, elevate the wound above the level of the heart to reduce blood loss. ');
INSERT INTO `first_aid_content` (`content_id`, `fa_id`, `content_image`, `content`) VALUES
(5, 1, , 'Monitor the person’s breathing, pulse, and level of consciousness. ');
INSERT INTO `first_aid_content` (`content_id`, `fa_id`, `content_image`, `content`) VALUES
(6, 1, , 'If they stop breathing, start CPR.');
INSERT INTO `first_aid_content` (`content_id`, `fa_id`, `content_image`, `content`) VALUES
(7, 1, , 'If they have a seizure, protect their head from hitting the ground and do not restrain them. ');
INSERT INTO `first_aid_content` (`content_id`, `fa_id`, `content_image`, `content`) VALUES
(8, 1, , 'Watch for signs of shock, such as pale skin, cold sweat, rapid breathing, or fainting. If the person shows signs of shock, cover them with a blanket or coat to keep them warm. ');

